import React from 'react'
import styled from 'styled-components'

import {SideBarStyled} from '../sidebar'
import {TextBlack, TextBlackUnderline} from '../text/index'
import AvatarSquareCard from '../cards/AvatarSquareCard'

const InfoBarStyled = styled(SideBarStyled)`
    width : 225px;

`

const ItemInfoBarStyled = styled.div`
    margin : 10px 0;
    padding : 10px ;
    
`
//height : 595px
//width : 225px 
// margin-left : 1128px
export  function InfoSideBar() {
    return (
        <div>
            <InfoBarStyled>
                <ItemInfoBarStyled>
                    <TextBlackUnderline fontSize="16px">Profile</TextBlackUnderline>
                    <hr/>
                    <AvatarSquareCard/>
                </ItemInfoBarStyled>
            </InfoBarStyled>
        </div>
    )
}
